import React from 'react';
import { ImageCardContainer } from './styles';


function ImageCard({ imageTitle, imageURL, categoryColor }) {
  const image = `imageURL`;
  return (
    <ImageCardContainer
      url={image}
      href={imageURL}
      target="_blank"
      style={{ borderColor: categoryColor || 'red' }}
      title={imageTitle}
    />
  );
}

export default ImageCard;
